import React from "react";
import ListItem from "../ListItem/ListItem.js";

export default function List({ todos, deleteHandler, handleCheck }) {
  return (
    <div>
      {todos.map((obj, num) => (
        <ListItem
          text={obj.text}
          check={obj.check}
          deleteHandler={() => deleteHandler(num)}
          onChange={() => {
            const modTodos = [...todos];
            modTodos[i].check = !modTodos[i].check;
            setTodos(modTodos);
          }}
        />
      ))}
    </div>
  );
}
